<script>
  import { onMount } from "svelte";
  import { createTimeline, svg, stagger } from "animejs";

  export let duration = 4000;
  export let strokeColor = "#000000";
  export let strokeWidth = 4;
  export let autoplay = true;
  export let loop = false;

  let svgEl;
  let timeline;

  onMount(() => {
    // Get paths within this specific component instance
    const paths = svgEl.querySelectorAll("path");

    if (!paths || paths.length === 0) {
      console.warn("[JmodDrawable] No paths found");
      return;
    }

    timeline = createTimeline({
      autoplay: autoplay,
      loop: loop,
    });

    timeline.add(svg.createDrawable(paths), {
      draw: ["0 0", "0 1", "1 1"],
      strokeWidth: [0, strokeWidth],
      duration: duration,
      ease: "inOutSine",
      delay: stagger(Math.round(duration * 0.02)),
    });

    return () => {
      if (timeline) timeline.pause();
    };
  });

  export const play = () => timeline?.play();
  export const pause = () => timeline?.pause();
  export const restart = () => timeline?.restart();
</script>

